import React from 'react'

function Homelogo({ Icon, tittle}) {
    return (
        <div className="homepage">
        
               <Icon className="logodiv"/> 
                  <div style={{width:'20px',backgroundColor:'black'}}>
            <h4>{tittle}</h4>
            </div>
        </div>
    )
}

export default Homelogo
